import React from "react";

const Explore = () => {
  const url = "/images/explore.jpg";

  return (
    <div>
      <h1>Explore Airbnb</h1>
      <div>
        <div
          style={{
            width: "389.33px",
            height: "84px",
            backgroundImage: `url(${url})`
          }}
        >
          <div style={{ padding: "0px 16px 0px 24px" }}>
            <h2>Stays</h2>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Explore;
